   /**
   * Reservar una salida de material
   * Reservar el ldoc
   * Reservar el MAC
   * Si no ha sido posible reservar el mac, devuelve <code>false</code>
   * @param idTraslo
   */
  public boolean reservarSalida(int idTraslo)
  {
    Number canAReservar;
    if (getCandis().compareTo(getCanpen()) > 0)
      canAReservar = new Number(getCanpen());
    else
      canAReservar = new Number(getCandis());
    SgamacViewRowImpl macRow = (SgamacViewRowImpl)getSgamacView();
    if (macRow.reservarSalidaMaterial(getUbides(), getIdart(), canAReservar, idTraslo))
    {
      SgaldocViewRowImpl ldocRow = (SgaldocViewRowImpl)getSgaldocView();
      ldocRow.reservarSalida(getIdmac(), canAReservar);
      return true;
    }
    return false;
  }

 
